// MyComponent.js

import React from 'react';
import useLanguage from './Lang/useLanguage';

const MyComponent = () => {
  const { translate } = useLanguage();

  return (
    <div>
      <h1>{translate('welcome')}</h1>
      <p>{translate('hello')}</p>
    </div>
  );
};

export default MyComponent;
